INSERT INTO silverhat_games VALUES("1","Do The Dive","dothedive.png","dothedive.jpg","Skydiving would be so much fun in a calm and nice weather. Imagine, its like flying in the sky and the moment you jump from the plane makes it even more exciting.\nDo the dive is a free online adventure game which takes you across the sky, taking risks and making decisions to determine your final score. Glide your way through the sky filled with dangerous Rocky Mountains with high towers & tall coniferous trees. Pick up diamonds as you go down to score the ultimate high score. Depleting level of oxygen reduces the chances of survival, so keep collecting the oxygen bottles as you go down. Oxygen is placed in locations designed to test your diving skills to the max. Oh! And dont forget about the angry birds who bash into you causing sudden loss of oxygen. As you go down the sky, the level increases causing more obstacles to appear and making it harder for you to survive. \nYour challenge is to go down and make the highest score possible. Can you reach the ground before the oxygen runs out? Can you survive this extreme adventurous job? Find out by playing this online action game!\n","1","2500","DoTheDive/","yes","2015-07-25 03:08:04","2015-07-25 03:15:17","yes","do-the-dive","Do the Dive - Play Stunt Games Online | Maverick Game","do the dive, maverick game, adventure game, stunt games, stunt games online, adventure games for girls, adventure games for boys, action game, diving game, play adventure games","Do the Dive is a adventure, stunt game featuring jumping from a plane- without a parachute! Play adventure games for girls and boys at Maverick Game.","dothedrive.png","banner-do-the-dive.jpg","dothedive.jpg","dothedive.jpg","dothedrive.jpg","thumb_dothedive.jpg");
INSERT INTO silverhat_games VALUES("2","Furious Red","furiousred.png","furiousred.jpg","Either diving, racing or drifting, doesnt matter what you call it but they are the adrenaline rushing deviations of outdoor sports and the online version is no less. They are the most played and wanted category in online gaming and especially for the teens who are enthusiasts and show a keen interest in cars. Its not just the speed which gives you a pull towards racing games, its the fun and enjoyment that you derive from all the adventure and mission that you have.\nThe Furious Red is car racing game for boys which is all about when youre getting late to be somewhere and youre on a traffic congested road, so you put your foot down and go as fast as you can splitting the lanes and overtaking the cars. But the best part is that you have to do it driving an amazing GT-F1 supercar which is superfast and has an amazing hopping ability plus handles amazingly. All you have to do is avoid crash, collect points and reach you destination on time.\nI bet your car can handle it, but can you? Play this free online racing game and many other car racing games here!\n","1","500","FuriousRed/","yes","2015-07-25 06:19:19","2015-07-25 04:11:10","yes","furious-red","Furious Red - Car Racing Games for Boys | Maverick Game ","furious red, racing games, racer games, car racing games, online car racing games, car racing games online, free download car racing games, car racing games for boys, super car racing games","Who needs a Speed Racer game when you have Furious Red featuring a GT-F1 super car? Play crazy super car racing games for boys at Maverick Game!","furiousred.png","banner-furious-red.jpg","furiousred.jpg","furiousred.jpg","furiousred.jpg","thmub_furiousred.jpg");
INSERT INTO silverhat_games VALUES("3","Master Cook","master-cook.png","master-cook.jpg","Girls love cooking as it provides you with the most delicious and amazing meals plus improves the skills every time you do it. Cooking Games are among the best online games which give you a similar experience- you have to do your best and try make the meal as deliciously as possible! This will entertain you and teach you everything you need to know about the kitchen. There\'s no need for reservations because we\'ve got a game waiting for you at our Restaurant Game. \nWe\'ve got the game where you have to cook just like Mom used to cook! Master Cook is a online role playing game which is about you owning a perfect, new little restaurant, where you have to cook delicious noodles, mix them with the vegetables and serve them as the customer want it. You have a queue of customers waiting to be served. Serve as soon as possible and as similar to their wants to get a handsome tip and money for the meal.\nBe the greatest chef of all time by serving your customers food that satisfies them and grow your business by serving delicacies on time. So grab your spoon and spatula and start mixing, boiling, and sauting with our game. You can play games online here!\n","1","1200","MasterCook/","yes","2015-07-27 05:08:08","2015-07-27 05:08:08","yes","master-cook","Master Cook - Play Cooking Games for Girls | Maverick Game","Master cook, maverick game, girls cooking games online, cooking games for girls, cooking games for girl, free online cooking games, games for girls, cooking games for kids","Master Cook lets you create the most sumptuous dishes to serve in your very own restaurant! Cook with your heart in cooking games for girls!","mastercook.png","banner-master-cook.jpg","master-cook.jpg","mastercook.jpg","mastercook.jpg","thumb_master-cook.jpg");
INSERT INTO silverhat_games VALUES("4","Wordster","wordster.png","wordster.jpg","Wordster is a word builder game which are popular for helping kids recognize words. In searching for words, the kids read and memorize the words in a way that they enjoy and which helps them learn the words and their spelling. Wordster is a free online game. The technology for Wordster game is shared with a very vast dictionary of beginner and advanced words.\nIn this game you are given a forest theme. You get letters carved on pieces of stones from which you have to make words. You have a limited amount of time available so that you start thinking quickly and learn to think under stressed and difficult situations. To prevent the time from running out you have to be quick at making new words which gets you more leverage on time. You are also rewarded with a score based on the length of the word- the bigger the word, the bigger the score.\nWould you let this bee help you make your vocabulary better? In this mysterious forest pick up the stones with letters on it and make as many words as you can before the timer runs out. Play Wordster, an amazing kids game online here and learn new words the fun way.\n","1","150","Wordster/","yes","2015-07-29 00:00:00","2015-07-27 00:00:00","yes","word-ster","Wordster - Play Word Puzzle Games Online | Maverick Game","wordster, maverick game, word puzzle games, spelling games, preschool games, kindergaten games","Wordster is one of the best spelling games for your little one. Play word puzzle games and other preschool games at Maverick Game!","wordster.png","banner-wordster.jpg","wordster.jpg","wordster.jpg","wordster.jpg","thumb_wordster.jpg");
INSERT INTO silverhat_games VALUES("5","Dragon Draft","dragondraft.png","draon-draft.jpg","Did you know the draft game has a history that spans thousands of years? There has been many discoveries in the ancient cities of Sumer and Egypt about similar strategy games that were played by royalty and soldiers. In ancient China, Rome and Greece, soldiers and generals used to play the draft game in order to hone their martial skills and make battle plans.INSERT INTO silverhat_games VALUES("6","Crisis","crisis.png","crisis.jpg","You feel the hollows burning, now you\'re learning. It aint no attempted murder as you\'re a solider. Do the math or a blast, bullets go through the glass. CRISIS - An intense shooting game for all the snipers, shooters and blasters! In here, VIP\'s are held hostage and you got to show your best aiming and gunning skill in order to save them by bringing down the terrorists. Run, run till their spun, one shot and one gun. Rescue all of them to level up and earn rewards plus be on top of the leaderboard. Use your mouse to aim at the terrorist and Shoot\'em down to rescue hostages. So pull the trigger like a Pro-Mayn and let your gun go off! Make\'em feel the flame when you fire on their brain!\n\nC.R.I.S.I.S is in the house, Yeah! Now Thats your Clique!","1","400","Crisis/","yes","2015-10-08 00:00:00","2015-10-08 00:00:00","yes","crisis","Crisis- Online Shooting Game for PC | Maverick Game","crisis, crisis shooting game, maverick game, online shooting game, shooting games for pc, shooting games online play","Crisis is one of the best online shooting games for Pakistanis featuring celebrities and politicians. Guaranteed to be a favorite with Pakistani gamers!","","","crisis.jpg","","crisis.jpg","thumb_crisis.jpg");
